function btnUploadFSC_Click() {
    DisplayProgress();
    document.getElementById('lblStatus').innerText = 'Uploading New FSC File...';
    document.getElementById('lblProgressText').innerText = 'Uploading New FSC File...';
}

function DisplayProgress() {
    document.getElementById('DivUpdateProgress').style.display = "inline";
}